package Corejava;

public class FibonacciDemo {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		//int n=7;
		int f=0;
		int s=1;
		int t;
		System.out.println(f);
		System.out.println(s);
		for(int i=1;i<8;i++)
		{
		t=f+s;
		System.out.println(t);
		f=s;
		s=t;
		}
		}
		}



